import { Link } from "react-router-dom";

const Banner = () => {
  return (
    <>
      <div className="container">
        <div>
          <h3>New Inspiration 2020</h3>
          <p>20% off on new season</p>
          <Link to="/shop">Browse collections</Link>
        </div>
      </div>
    </>
  );
};

export default Banner;
